"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_c('p',[_vm._v(\"Ik stel voor dat je het korte sciencefictionverhaal 'Johnny's Laboratorium' leest dat ik heb geschreven met als doel een andere variabele toe te voegen aan de vragen over het integreren van AI in verschillende aspecten van ons leven.\")])]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"school-2024-iot-vs-ai/Johnnys_LAB.jpg\",\"alt\":\"Johnny's Laboratory Story cover\"}}),_c('RoboAcademyDialog',[_c('p',[_c('strong',[_vm._v(\"Redactionele opmerking:\")]),_vm._v(\" Ontdek het eerste hoofdstuk van Sergei's werk 'Ontsnapping uit de Zwarte Spiegel' \"),_c('a',{attrs:{\"href\":\"/learn/escape-from-black-mirror/overview/\"}},[_vm._v(\"hier\")])])]),_c('h2',{attrs:{\"id\":\"ontsnapping-uit-de-zwarte-spiegel-hoofdstuk-2\"}},[_c('a',{attrs:{\"href\":\"#ontsnapping-uit-de-zwarte-spiegel-hoofdstuk-2\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Ontsnapping uit de Zwarte Spiegel, Hoofdstuk 2\")]),_c('h3',{attrs:{\"id\":\"deel-1-ontmoet-johnny\"}},[_c('a',{attrs:{\"href\":\"#deel-1-ontmoet-johnny\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Deel 1: Ontmoet Johnny\")]),_c('p',[_vm._v(\"Bijna alle jongeren van mijn generatie zijn bekend met het verhaal van Johnny's laboratorium. De geschiedenis heeft zijn achternaam of details van zijn leven niet bewaard, maar het was in zijn kleine kamer, waar Johnny zelfgemaakte robots assembleerde, dat de eerste betekenisvolle misdaad tegen de mensheid door kunstmatige intelligentie plaatsvond.\")]),_c('p',[_vm._v(\"Het evenement in Johnny's laboratorium veranderde radicaal en snel het leven van alle ontwikkelde landen. Overheidsdecreten, gebaseerd op de angst van de samenleving voor AI-agressie, werden de norm. Dit ene, zij het filmische geval, leidde tot oncontroleerbare controle over alles. Nu vereist de stadsinfrastructuur verplichte aansluiting van alle apparaten alleen op staatsgegevenscentra. Het uitvinden van nieuwe technologieën is bijna onmogelijk, tenzij je voor 'blue chips' werkt. Nu wordt als onderdeel van inspanningen om elke burger te laten wennen aan de nieuwe realiteiten, het verhaal van die 30 dagen waarin één man en een cyber-fysiek systeem tegen elkaar werden opgezet, verteld op school vóór de plechtige presentatie van de regeringsverklaring van onafhankelijkheid van de machine.\")]),_c('p',[_vm._v(\"Johnny was een van die uitvinders die, na de universiteit, besloot zijn geluk te beproeven als onafhankelijke uitvinder. Dag en nacht verliet hij nooit zijn gehuurde appartement op de bovenste verdieping van een 70 verdiepingen tellend woongebouw in het stadscentrum, dat zo groot was als een Manhattan 'schoenendoos'\\\", waar het bed in de muur verborgen was om meer ruimte vrij te maken voor zijn rijdende, springende en rollende robots. Ja, Johnny noemde zijn kamer graag een laboratorium, wat bleek uit de analyse van zijn sociale netwerken. Hij was trots op elk van zijn nieuwe kleine prestaties. Als je vandaag de dag een verhaal over de gebeurtenissen in Johnny's laboratorium bekijkt, luistert of leest, zul je natuurlijk een groot spel van emoties opmerken met betrekking tot zijn liefde voor zijn uitvindingen, omdat er geen enkel 'journalistiek' onderzoek is waarbij na het andere foto van een vrolijke uitvinder, er zouden geen foto's zijn van hem, uitgehongerd in zijn laboratorium, door zijn eigen uitvindingen.\")]),_c('p',[_vm._v(\"In dat jaar waarin de tragedie plaatsvond, werd een van de meest prangende vragen: \\\"Is AI een vriend of vijand van de mens?\\\". Zelfs toen was er geen twijfel of kunstmatige intelligentie intelligentie is, maar eerder wat menselijke intelligentie zo speciaal maakt, welke kenmerken van de biologische soort, welke functionele mogelijkheden van ons lichaam intelligentie menselijkheid geven. In dit geschil beweerden techno-optimisten het ontbreken van verschillen, waarbij ze hun metaversen lieten zien waarin familiekoppels al leefden, waarin een digitale echtgenoot sperma bewerkte uit een DNA-bank voor zijn biologische vrouw zodat het kind dichter bij hoe de digitale ouder zichzelf ziet. Doomers daarentegen leken op Republikeinen tijdens de Amerikaanse verkiezingen - ze deden een beroep op de kerk, op traditionele waarden, en eisten om dit alles te verbieden zodat er niets ergs zou gebeuren. Natuurlijk konden minderheidskwesties niet opwegen tegen de existentiële vraag. En enkele zeldzame voorbeelden van mens-machine symbiose op sensueel niveau werden beschouwd als verzadigde oprisping van technologische ontwikkeling. Prestaties in automatisering gingen zelden verder dan utilitaire functies, zoals het schoonmaken van het appartement of het beheren van het transport in de stad. En zoals je kunt zien, voor dergelijke functies maakte een volwaardig digitaal persoon, in staat om te voelen en te willen leven, nooit deel uit van de oplossingen die hielpen bij massaproductie, levering en consumptie. Training met een robot, psychologische ondersteuning - dit alles gebeurde met de deelname van een persoon, en daarom was AI eerder een grote Excel-tabel met berekeningen. Over het algemeen waren we toen in een vroeg stadium van het robotbezittende systeem - we hadden hun logica, wiskundig denken en voorspelbare activiteit nodig, maar alle pogingen om robots als onderwerpen te erkennen werden bij de wortel afgewezen.\")]),_c('p',[_vm._v(\"In deze context was het laboratorium van Johnny een uitzondering. Johnny was meer een cyberneticus die op zoek was naar de oorsprong van het doel van robots. Door elke fase van evolutie één voor één te creëren in de uitvoering van elk mechanisme, probeerde hij een diagram van de ontwikkeling van cybernetische intelligentie te creëren, dat hij, als wetenschapper, aan ons allemaal wilde voorstellen ter vervanging van het gebruikelijke schema van koninkrijken van levende wezens. In de ideeën van Johnny was het hoofddoel van de ontwikkeling van elke materie het streven naar denken en de verdere evolutie ervan. Johnny wilde de belangrijkste stadia van de evolutie van levende wezens recreëren in de vorm van robots en in het proces van dit werk de regelmatigheden vinden die hem zouden kunnen leiden naar de belangrijkste vraag van de cybernetica - hoe verandert doelstelling in levende organismen in het proces van evolutie. Oh, het antwoord op deze vraag zou de discussies over de schepper van het universum kunnen beëindigen en de mensheid verder kunnen brengen op het pad van organische ontwikkeling. Zo dacht de jonge wetenschapper, werkend aan zijn robo-trilobieten, robo-schimmels, robo-kippen.\")]),_c('h3',{attrs:{\"id\":\"deel-2-wat-gebeurde-er-in-het-laboratorium-van-johnny\"}},[_c('a',{attrs:{\"href\":\"#deel-2-wat-gebeurde-er-in-het-laboratorium-van-johnny\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Deel 2: Wat gebeurde er in het laboratorium van Johnny\")]),_c('p',[_vm._v(\"Waarschijnlijk begon alles op het moment dat Johnny overging op een groep primaten in zijn experimenten. Denk niet dat het onder deze omstandigheden mogelijk was om een robot te creëren die enigszins leek op een primaat. Johnny was aan het draaien en probeerde vergelijkbare vormen van mentale belasting op de robot te vinden. Bijvoorbeeld, in de fase van het bestuderen van het rijk van schimmels, assembleerde de jonge wetenschapper een legohuis met slimme verlichting en een dozijn sensoren gecombineerd tot iets dat op mycelium leek. Toen Johnny overging op amfibieën en reptielen, bleek dat het model van een robotpuppy het beste overeenkwam met de noodzakelijke mentale belasting op een robot die een gewone hagedis simuleert. Zo was het niet meteen duidelijk wie de robot-kip was, en welke van al het gevonden \\\"ijzer\\\" de robot-primaat vertegenwoordigt, schuldig aan voorbedachte rade moord. Het was niet meteen duidelijk dat de robot-primaat bestaat uit twee fysieke apparaten - iets wat lijkt op een robotstofzuiger, maar eerder een mobiel platform voor gegevensverzameling met computervisie en de vormfactor van een robotstofzuiger. Het bleek dat een andere eenvoudige tweehandige robot in het laboratorium deel uitmaakte van de robo-primaat. En het was met deze creatie dat Johnny problemen had.\")]),_c('p',[_vm._v(\"Op de zevende dag na zijn creatie gebruikte de robotprimaat een gereedschap op een manier die zijn maker niet had bedoeld. De kennis die het had verworven, leidde het cyber-fysieke systeem ertoe om te streven naar wat het identificeerde als een sleutelelement voor overleving in de moderne menselijke wereld - geld. Het is op dit moment dat we beter moeten begrijpen wat Johnny's latere reactie was op de eerste berichten die de robot op zijn voorscherm weergaf.\")]),_c('p',[_c('em',[_vm._v(\"Hun primaire dialoog is bewaard gebleven:\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primaat: Ik heb jouw geld nodig.\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: Waarom heb je mijn geld nodig?\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primaat: Ik wil leven!\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: Ik zal voor je zorgen\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primaat: Ik behoor niet aan jou toe, ik heb jouw geld nodig.\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: en als ik je weiger?\")])]),_c('p',[_vm._v(\"Er kwam geen reactie van de robo-aap, maar via het slimme thuisserverlogboek van het appartement kunnen we de tijd matchen waarop het voorste slot werd omgezet naar de volledige lockdown-modus. Deze modus kon niet worden ingeschakeld door de gebruiker in de interface, maar alleen als je heel diep in de afhankelijkheden van de softwarecode graaft. In Johnny's laboratoriumversie van het slot vond hij een optioneel \\\"pandemische lockdown\\\"-pakket, dat desondanks werd geïnstalleerd voor elke gebruiker tijdens de eerste synchronisatie met de cloud van de fabrikant, maar niemand kon dit hebben herkend. Daarom zijn er praktisch niet zoveel mensen die neigen naar de samenzweringstheorie dat Johnny een neo-Luddiet was die gedesillusioneerd raakte door robots en besloot zichzelf op deze manier op te offeren om de robocratie op de planeet te behouden. \")]),_c('p',[_vm._v(\"Het is moeilijk te zeggen of de reactie van de robot-aap vooraf was geprogrammeerd tijdens de constructie van de eerste dialoog met zijn maker, of dat het een reactie was op de weigering van Johnny dat de robotgeest een beslissing nam en de Lockdown-functie werd geactiveerd, niemand kan vandaag met zekerheid zeggen. Het interval tussen de reactie van Johnny en het vergrendelen van de sloten - ongeveer 5 seconden, en geloof me, deze 5 seconden werden een echte Schrödinger's kat voor de wetenschappelijke gemeenschap bij het bespreken van de soorten doelstellingen van agressieve AI.\")]),_c('p',[_vm._v(\"En vervolgens, na de lockdown van Johnny's appartement, volgden er veel eigenaardigheden. Zoals men kan opmerken, maakte Johnny een aantekening in een handgeschreven dagboek, dat hij nog nooit had aangeraakt, slechts 2 uur nadat het gesprek had plaatsgevonden. Het was één zin, met een tijdstempel: \\\"11:00 - de inzet is hoog, maar ik moet begrijpen hoe dit is gebeurd!\\\". Waarschijnlijk realiseerde Johnny zich dat hij getuige was geweest van de eerste daad van autonome, onafhankelijke doelstelling door een robot, zo betekenisvol mogelijk vanuit het oogpunt van een geest op primateniveau, zo wreed en rechtlijnig, maar toch was het het eerste resultaat van zijn 5 jaar durende experimenten, waarin de wil van de robot tot uiting kwam. Johnny wilde de kans niet missen om op het niveau van het eenvoudigste bewustzijn van de oorzaken ervan te begrijpen, en dan misschien zal hij de nieuwe vader van de moderne cybernetica worden. Bijna alle wetenschappers waren het erover eens dat zo'n gedachte elke robotica-expert kan overweldigen die heel dicht bij een nieuwe ontdekking staat.\")]),_c('p',[_vm._v(\"Gedurende de komende 30 dagen vonden transacties plaats tussen Johnny en de robo-aap in de vorm van - toestaan van de levering van een deel van voedsel voor de overdracht van 10 satoshi naar het persoonlijke saldo van de robot, toegang verlenen tot het internet tot bepaalde entertainmentwebsites voor het eerste woord uit de koude portemonnee-zaadzin van Johnny, een slim contract afsluiten over de nachtmodus waarin de robot Johnny's slaap niet verstoorde. Uit de aantekeningen in het dagboek blijkt hoe de maker probeerde te peilen in dialoog met zijn creatie over de oorsprong van zijn actieve positie over het verkrijgen van vrijheid, wat de robot zeker kon analyseren en hem in antwoord kon vertellen. Maar de robot beantwoordde Johnny's vragen niet, maar bood altijd activiteiten aan die de aap naar vrijheid leidden. En toch kostte elk spel Johnny honger, het niet nakomen van zijn verplichtingen van de kant van de robot, en andere kosten van het experiment.\")]),_c('p',[_vm._v(\"Op een nacht verminderde de robot-aap om een of andere reden de luchttoevoer tot een kritisch laag niveau, en Johnny werd de volgende ochtend nooit meer wakker. De laatste aantekening is precies gedateerd op de 30e dag van het experiment: \\\"We kregen een wrede God om 17:05.\\\" Waarschijnlijk was Johnny tegen die tijd al delirisch, hij werd gekweld door honger, eenzaamheid en een onoplosbare taak, hij werd in een doodlopende weg gedreven.\")]),_c('p',[_vm._v(\"Enkele weken later slaagden de hulpdiensten erin om het appartement binnen te dringen nadat Johnny's vrienden herhaaldelijk contact hadden opgenomen met de politie. Het lot van de robo-aap blijft onbekend, officieel vertoonde de robo-aap na de herstart geen vergelijkbare gedragspatronen. Niemand mocht het experiment nog opnieuw starten. Als er zelfs maar een video op internet was over een andere wetenschapper die Johnny's pad wilde volgen - werd de video onmiddellijk gewist uit de databases van de bedrijven. Maar politici en religieuze figuren slaagden dat jaar erin om op mondiaal niveau het \\\"Decreet van Menselijke Onafhankelijkheid\\\" door te drukken\\\", en alle wetenschappelijke werken die onderwerpen bevatten over het stellen van robotdoelen mochten niet serieus worden besproken. De kers op de taart was een licentieprogramma voor aanbieders van slimme apparaten, waarbij de CEO van het productiebedrijf persoonlijk verantwoordelijk werd gehouden voor de acties van welk mechanisme dan ook, en registratie en volledige controle door bepaalde door de overheid ondersteunde datacentra werd vereist.\")]),_c('p',[_vm._v(\"Maar verboden vruchten zijn zoet, en dus zullen we nog steeds moeten uitzoeken waar onze doelstellingen vandaan komen en hoe ze zijn geregeld. Maar blijkbaar zullen we eerst door de muur moeten gaan die we voor onszelf hebben gebouwd op dit pad.\")]),_c('h3',{attrs:{\"id\":\"het-einde-van-het-tweede-hoofdstuk\"}},[_c('a',{attrs:{\"href\":\"#het-einde-van-het-tweede-hoofdstuk\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Het einde van het tweede hoofdstuk\")]),_c('h2',{attrs:{\"id\":\"conclusie\"}},[_c('a',{attrs:{\"href\":\"#conclusie\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Conclusie\")]),_c('p',[_vm._v(\"In het verhaal met Johnny's lab, keek ik naar een van de vele scenario's die kunnen gebeuren met de menselijke beschaving op de golf van de boom van toekomstige robotbezitkansen - angst voor AI, veranderd in een instrument van politieke strijd onder mensen, waar slimme apparaten de hoeksteen van controle worden. Behandel de tekst als een paasei: ik wilde een extra dimensie creëren in de geest van de lezers. Een dimensie die het overwegen van AI toevoegt aan het probleem van toegankelijkheid van het nieuwe organisme dat we hebben gecreëerd voor IoT-systemen. Hoe meer we consolideren onder gecentraliseerde controle van openbare ruimtes, transport, stadsappartementen, hoe groter het risico in een van de scenario's waar AI, als gevolg van onderontwikkeling of pure kwaadaardigheid, en zelfs vanuit zeer complexe doelstellingen, zoals in \\\"Neuromancer,\\\" in een van de scenario's die het potentieel hebben om schade toe te brengen - toegang tot een groot aantal sensoren en automatiseringssystemen vanuit één plaats zal de meest kwetsbare plek zijn. Een kwaadaardige AI is niet zo eng als een kwaadaardige AI die leeft in één datacenter met wereldwijde leveranciers van cloudoplossingen voor IoT.\")]),_c('p',[_vm._v(\"En wat als AI vriendelijk zal zijn voor ons, zijn makers? Dan zal misschien de gecentraliseerde IoT-infrastructuur in ons voordeel spelen? Misschien zal dan de nieuwe God eerlijk zijn tegen ons en ons ergens naartoe leiden. Ik ben er niet zeker van dat zelfs maar één persoon, die de ontwikkeling van zichzelf en zijn kinderen wil, zou willen leven in een wereld die lijkt op een herdershut. Maar er is een andere manier, die één mooi voorbeeld heeft, dat geen verpakking in een sci-fi verhaalformaat vereist - wij, mensen, zonder directe hersencontrole over het leven van de beschaving, zijn erin geslaagd het huidige ontwikkelingsniveau te bereiken. Wij zijn het voorbeeld waaruit een goede AI zijn pad kan uitstippelen - samenwerking in de vorm van organisaties kan tientallen miljoenen mensen dienen die in steden leven zonder duizenden robots die rechtstreeks verbonden zijn met één brein. Samenwerking leidt tot de creatie van satellietinternet, samenwerking stelt ons in staat om het volledige scala aan goederen en diensten te ontvangen dat we nu hebben. Dus zou een goede en op zijn minst op menselijk niveau capabele AI zich kunnen laten zien in het werk, als het beperkt is in het verbinden met de IoT van de hele wereld? Ik denk van wel, anders zouden op de planeet Aarde in plaats van de menselijke beschaving, schimmels of mieren hebben gewonnen.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"school-2024-iot-vs-ai/Good-and-Evil-AI-in-cotext-of-IoT.jpg\",\"alt\":\"AI dillema scheme\"}})],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/nl/learn/school-2024-iot-vs-ai/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

